double rho_Lookup_R744(double T, double P)
{ 
	int nT=251, nP=100,L,R,M;
	int iPlow, iPhigh, iTlow, iThigh;
	double T1, T2, T3, P1, P2, P3, y1, y2, y3, a1, a2, a3;
	double BubbleError;

    if (T<250 || T > 500 || P<517.95 || P>16000)
    {
        printf("Inputs to rho out of bounds:  T=%g K \t P=%g kPa \n",T,P);
		return BubbleError;
		//mexPrintf("Inputs to rho out of bounds:  T=%g K \t P=%g kPa \n",T,P);
        //mexErrMsgTxt("Inputs out of bounds");
    }
    
	L=0;
	R=nT-1;
	M=(L+R)/2;
	
	// Use interval halving to find the indices which bracket the angle of interest
	while (R-L>1)
	{
		if (T>=T_vec[M])
		{
			L=M;
			M=(L+R)/2;
		}
		if (T<T_vec[M])
		{
			R=M;
			M=(L+R)/2;
		}
	}
	iTlow=L; iThigh=R;

	L=0;
	R=nP-1;
	M=(L+R)/2;
	
	// Use interval halving to find the indices which bracket the angle of interest
	while (R-L>1)
	{
		if (P>=P_vec[M])
		{
			L=M;
			M=(L+R)/2;
		}
		if (P<P_vec[M])
		{
			R=M;
			M=(L+R)/2;
		}
	}
	iPlow=L; iPhigh=R;


	/*for(i=0;i<nT-1;i++)
	{ 
		if ((T>T_vec[i] && T<=T_vec[i+1]) || (T<T_vec[i] && T>=T_vec[i+1])) 
		{ 
 			iTlow=i; iThigh=i+1; 
		}
	}

	for(i=0;i<nP-1;i++)
	{ 
		if ((P>P_vec[i] && P<=P_vec[i+1]) || (P<P_vec[i] && P>=P_vec[i+1])) 
		{ 
 			iPlow=i; iPhigh=i+1; 
		}
	}*/

	//At Low Temperature Index
	y1=rho_vec[(iPlow)*nT+iTlow];
	y2=rho_vec[(iPhigh)*nT+iTlow];
	y3=rho_vec[(iPhigh+1)*nT+iTlow];
	P1=P_vec[iPlow];
	P2=P_vec[iPhigh];
	P3=P_vec[iPhigh+1];
	a1=QuadInterp(P1,P2,P3,y1,y2,y3,P);

	//At High Temperature Index
	y1=rho_vec[(iPlow)*nT+iThigh];
	y2=rho_vec[(iPhigh)*nT+iThigh];
	y3=rho_vec[(iPhigh+1)*nT+iThigh];
	a2=QuadInterp(P1,P2,P3,y1,y2,y3,P);

	//At High Temperature Index+1 (for QuadInterp() )
	y1=rho_vec[(iPlow)*nT+iThigh+1];
	y2=rho_vec[(iPhigh)*nT+iThigh+1];
	y3=rho_vec[(iPhigh+1)*nT+iThigh+1];
	a3=QuadInterp(P1,P2,P3,y1,y2,y3,P);

	//At Final Interpolation
	T1=T_vec[iTlow];
	T2=T_vec[iThigh];
	T3=T_vec[iThigh+1];
	return QuadInterp(T1,T2,T3,a1,a2,a3,T);
}

